export const Icon = ({
  name,
  size = 3,
  color = "currentColor",
  role = "presentation",
  focusable = "false",
  sx,
  ...rest
}) => {
  const { theme } = useThemeUI();
  const icons = { ...theme.icons };

  if (!icons[name]) {
    console.error(`No icon found with name ${name}`);
    return null;
  }

  return (
    <Box
      as="svg"
      sx={{ ...sx, size: size }}
      viewBox={icons[name].viewBox || "0 0 24 24"}
      color={color}
      display="inline-block"
      verticalAlign="middle"
      focusable={focusable}
      role={role}
      {...rest}
    >
      {icons[name].path}
    </Box>
  );
};
